import React, { useState } from "react";
import { database, ref, push } from "../firebase";

const SignupForm = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    mobile: "",
    address: "",
    authId: "",
    authKey: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const usersRef = ref(database, "users");
      await push(usersRef, formData);

      alert("‚úÖ Signup successful!");
      console.log("Saved to Firebase:", formData);

      setFormData({
        name: "",
        email: "",
        mobile: "",
        address: "",
        authId: "",
        authKey: "",
      });
    } catch (error) {
      console.error("‚ùå Error saving to Firebase:", error);
      alert("Something went wrong. Please try again.");
    }
  };

  return (
    <div style={styles.wrapper}>
      <form onSubmit={handleSubmit} style={styles.form}>
        <h2 style={styles.heading}>üöÄ Create Account</h2>
        <p style={styles.subtext}>Enter your details below. <strong>Auth Key is required for test access.</strong></p>

        {[
          { label: "Name", name: "name", type: "text", placeholder: "John Doe" },
          { label: "Email", name: "email", type: "email", placeholder: "johndoe@example.com" },
          { label: "Mobile", name: "mobile", type: "tel", placeholder: "+1234567890" },
          { label: "Auth ID", name: "authId", type: "text", placeholder: "MERCH-ABC123" },
          { label: "Auth Key", name: "authKey", type: "text", placeholder: "Your secret auth key" },
        ].map((field) => (
          <div style={styles.field} key={field.name}>
            <label style={styles.label}>{field.label} *</label>
            <input
              style={styles.input}
              type={field.type}
              name={field.name}
              value={formData[field.name]}
              onChange={handleChange}
              placeholder={field.placeholder}
              required
            />
          </div>
        ))}

        <div style={styles.field}>
          <label style={styles.label}>Address *</label>
          <textarea
            style={{ ...styles.input, height: "80px", resize: "vertical" }}
            name="address"
            value={formData.address}
            onChange={handleChange}
            placeholder="123 Main St, City, Country"
            required
          />
        </div>

        <button type="submit" style={styles.button}>Sign Up</button>
      </form>
    </div>
  );
};

const styles = {
  wrapper: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    minHeight: "100vh",
    backgroundColor: "#f0f2f5",
    padding: "40px 20px",
  },
  form: {
    width: "100%",
    maxWidth: "500px",
    backgroundColor: "#ffffff",
    padding: "30px",
    borderRadius: "12px",
    boxShadow: "0 12px 25px rgba(0,0,0,0.08)",
  },
  heading: {
    marginBottom: "10px",
    fontSize: "24px",
    color: "#1a1a1a",
    textAlign: "center",
  },
  subtext: {
    fontSize: "14px",
    color: "#555",
    marginBottom: "25px",
    textAlign: "center",
  },
  field: {
    marginBottom: "20px",
  },
  label: {
    display: "block",
    marginBottom: "8px",
    fontWeight: "600",
    color: "#333",
  },
  input: {
    width: "100%",
    padding: "12px 14px",
    fontSize: "15px",
    border: "1px solid #ccc",
    borderRadius: "6px",
    outline: "none",
    transition: "border-color 0.3s",
  },
  button: {
    width: "100%",
    padding: "14px",
    backgroundColor: "#007bff",
    color: "#fff",
    border: "none",
    fontSize: "16px",
    fontWeight: "600",
    borderRadius: "6px",
    cursor: "pointer",
    transition: "background-color 0.3s ease",
  },
};

export default SignupForm;
